import './App.css';
import { useNavigate } from 'react-router-dom';
import { findagame, homepage} from './pages';

function App() {
  const navigate = useNavigate();
  const location = useLocation();

  return (
    <div className="App">
      <homepage location={location} />
      <findagame location={location} />
    </div>
  );
}

export default App;
